async () => {
  const absolutePath = path.join(__dirname, "..", "assets", "test.json");

  const kvmdParse = await readJsonFile<KeyValueMarkdownParse>(absolutePath);

  if (!kvmdParse) {
    console.log("reading json file failed");
    return;
  }

  const string = kvmdParseToMarkdownString(kvmdParse);

  await writeStringToFile(
    absolutePath.replace("test.json", "stringifiedTest.md"),
    string
  );
}
